                        <div class=""col-12"">
                            <p class=""testfontsize"">
                                Regardless of your business, your relationships with your customers are your greatest asset in a tough economy.
                                Today, many organizations are looking at ways to become more client-centric, using supporting technologies such as customer
                                relationship management (CRM) software. But, with all the CRM solutions available today,
                                it can be difficult to know where to start in determining which solution best fits your needs.
                            </p>
