                    <div class="" row bt-3"">
                        <div class=""col-12"">
                            <p  class=""testfontsize"">
                          ");
                WriteLiteral(@"      The right CRM solution can embed best practices unique to your industry, work with your company's specific business processes,
                                help you keep pace with rapid changes in your business and market, deliver quantifiable business results, and mitigate expense
                                and risk for your business.
                            </p>
                        </div>
                    </div>
                    <div class="" row bt-3"">
                        <div class=""col-12"">
                            <p class=""testfontsize"">
                                A good CRM gives you insights into running your business. A smart CRM gives you the information you need in a way that you can use it.
                                An ideal CRM offers you a solution to simplify your processes from day one.Our  CRM includes the good, the smart,
